import React, { useState } from 'react';

export default function Alerts({ events = [], removeAlertByTs, onEmaInput, symbol: currentSymbol }) {
  // Only show primary alert events (bull/bear). Hide telegram_send / telegram status events
  const visible = (events || []).filter((ev) => {
    try {
      if (!ev || !ev.type) return false;
      const t = (ev.type || '').toString();
      // hide auxiliary telegram events
      if (t.startsWith('telegram')) return false;
      // show only bull/bear or similar alert types
      return t === 'bull' || t === 'bear' || t === 'alert';
    } catch (e) {
      return false;
    }
  });

  // local form state for manual EMA input (1m)
  const [sym, setSym] = useState(currentSymbol || '');
  const [ema9, setEma9] = useState('');
  const [ema26, setEma26] = useState('');

  function handleRun() {
    try {
      const n9 = Number(ema9);
      const n26 = Number(ema26);
      if (Number.isNaN(n9) || Number.isNaN(n26)) return;
      const payload = { symbol: (sym || currentSymbol || '').toString().replace(/[^A-Za-z0-9]/g, '').toUpperCase(), timeframe: '1m', ema9: n9, ema26: n26 };
      if (typeof onEmaInput === 'function') onEmaInput(payload);
      // clear inputs after running
      setEma9(''); setEma26('');
    } catch (e) {}
  }

  if ((!visible || visible.length === 0) && typeof onEmaInput !== 'function') return null;

  return (
    <div className="alerts">
      <div className="alerts-title">Alerts</div>
      <div style={{ display: 'flex', gap: 8, alignItems: 'center', margin: '8px 0' }}>
        <div style={{ fontSize: '0.9rem', color: '#444', minWidth: 120 }}>1m · EMA9 / EMA26</div>
        <input placeholder="Symbol" value={sym} onChange={(e) => setSym(e.target.value)} style={{ padding: '6px 8px', minWidth: 100 }} />
        <input placeholder="EMA9" value={ema9} onChange={(e) => setEma9(e.target.value)} style={{ padding: '6px 8px', width: 120 }} />
        <input placeholder="EMA26" value={ema26} onChange={(e) => setEma26(e.target.value)} style={{ padding: '6px 8px', width: 120 }} />
        <button onClick={handleRun} disabled={!ema9 || !ema26} className="scanner-btn green">Run</button>
      </div>
      <ul className="alerts-list">
        {visible.map((ev, i) => (
          <li key={ev?.ts ?? i} className="alert-item">
            <div className="alert-left">
              <span className={`alert-indicator ${ev.type === 'bull' ? 'bull' : 'bear'}`} />
              <div className="alert-symbol">{ev.symbol || ''}</div>
            </div>

            <div className="alert-body">
              <div className="alert-info">
                <div className="alert-type-short">{ev.type === 'bull' ? 'Bull' : 'Bear'}</div>
                <div className="alert-time">{ev.time}</div>
              </div>
              <div className="alert-right">
                <div className="alert-price">{typeof ev.price === 'number' ? ev.price : ev.price}</div>
                <div style={{fontSize:'0.7rem', color:'#666', marginTop:4}}>{ev.source || ''}</div>
                <button className="delete-btn" onClick={() => removeAlertByTs(ev.ts)} aria-label="삭제" title="삭제">✕</button>
              </div>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}
